import React, {useState, useEffect} from 'react';

function Lista () {      

  const [lomake, setLomake] = useState({nimi: '', kayttaja: '', kaupunki: ''});

  const fetchUrl = async () => {
    try {
        const response = await fetch('https://jsonplaceholder.typicode.com/users/5');
        const json = await response.json();

        setLomake({ nimi: json.name, kayttaja: json.username, kaupunki: json.address.city})  

        console.log(json);

    } catch (error) {
        console.log(error);
    } 
  }

  useEffect( () => { fetchUrl() }, []);

    return (
      <div>
        <header>Pöytävaraukset</header>
        <body>
        <div style={{paddingLeft: '10px', fontSize: 12}}>
                 <p>
                   Nimi: { lomake.nimi }<br/>
                   Käyttäjä: { lomake.kayttaja }<br/>
                   Kaupunki: { lomake.kaupunki }<br/>
                 </p>
      </div>
      </body>
      </div> 
      );
    }


  export default Lista;
